using System;
using System.Collections.Generic;
using System.Drawing;
using System.IO;
using System.Linq;
using System.Web;

using System.Web.Mvc;
using System.Web.Script.Serialization;

using System.Xml.Linq;
using WebAspFindGuide.Common;
using WebAspFindGuide.CustomAuthencation;
using WebAspFindGuide.Models;
using WebAspFindGuide.Models.Site_Model;

namespace WebAspFindGuide.Controllers
{
    [CustomAttribute(PermissionName ="Client|Guide|Admin")]
    public class Guide_RegistrationController : Controller
    {
        // GET: Guide_Registration
        public ActionResult Index()
        {
            return View();
        }
        [HttpPost]
        public ActionResult Lichtrinh(string lichtrinh)
        {
            var result = false;
            var Lt = new JavaScriptSerializer().Deserialize<List<string[]>>(lichtrinh);
            var id = ((CustomAccount)Session[Common.Const.Session_Account]).AccountID;
            if (!String.IsNullOrEmpty(id))
            {
                foreach (var item in Lt)
                {
                    var fileName = Code.Instance.generateID() + ".jpg";
                    string pathImg =Path.Combine(Server.MapPath("~/Assets/imageGuide/"), fileName);
                    string img = "";
                    
                    byte[] imgBytes = Convert.FromBase64String(img);
                   
                    using (MemoryStream ms = new MemoryStream(imgBytes))
                    {
                        using (Bitmap bm2 = new Bitmap(ms))
                        {
                            bm2.Save(pathImg);
                        }
                    }
                    XElement Schedule = new XElement("Schedule",
                        new XElement("place", item[0]),
                        new XElement("time", item[1]),
                        new XElement("img", fileName),
                        new XElement("content", item[3])
                        );
                    var res = Guide_Model.Instance.SaveSchedule(id, Schedule.ToString());
                }
            }
            
           
            return Json(result, JsonRequestBehavior.AllowGet);
        }
        [HttpPost]
        public ActionResult RegistrationInfo(string info)
        {
            var result = false;
          
            var Acc = new JavaScriptSerializer().Deserialize<string[]>(info);
            
            return Json( result , JsonRequestBehavior.AllowGet);
        }
    }
}